import defaultTheme from './default';
import customTheme from './custom';
import guestTheme from './guest';

const themes = {
  defaultTheme,
  guestTheme,
  customTheme,
};

export const themeConfig = {
  topbar: 'defaultTheme',
  sidebar: 'defaultTheme',
  layout: 'defaultTheme',
  theme: 'defaultTheme',
};
export default themes;
